window.bookSummaryJSON = "<p><b>Book 3 of the Quint Adler Series </b></p> <p><b>(If you're new to Quint, I'd suggest starting with Book 1, </b><b><i>Revenge at Sea</i></b><b>.)</b></p> <p>Quint earns his private investigator's license and heads off to Los Angeles to celebrate. Within a day of arriving, an old friend, now a Hollywood producer, tells Quint that he fears for his life.</p> <p>He's dead by the next morning. While Cara sees the seedy Hollywood underbelly for what it truly is, Quint ignores her warnings and sets off to catch the killer.</p> <p>With limited knowledge of Hollywood and an ever-increasing list of suspects, Quint has finally bitten off more than he could chew.</p> <p>Combining elements of the noir and the whodunnit, <b><i>Hollywood Murder Mystery</i></b> will keep you guessing until the final minute!</p>"; 
